DROP TABLE IF EXISTS `subscribe_application`;
CREATE TABLE IF NOT EXISTS `subscribe_application` (
                                         `id` bigint NOT NULL AUTO_INCREMENT,
                                         `name` varchar(255) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NOT NULL DEFAULT '' COMMENT 'Application Name',
                                         `icon` mediumtext CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci COMMENT 'Application Icon',
                                         `description` varchar(255) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci DEFAULT NULL COMMENT 'Application Description',
                                         `scheme` varchar(255) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NOT NULL DEFAULT '' COMMENT 'Application Scheme',
                                         `user_agent` varchar(255) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NOT NULL DEFAULT '' COMMENT 'User Agent',
                                         `is_default` tinyint(1) NOT NULL DEFAULT '0' COMMENT 'Is Default Application',
                                         `subscribe_template` mediumtext CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci COMMENT 'Subscribe Template',
                                         `output_format` varchar(50) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NOT NULL DEFAULT 'yaml' COMMENT 'Output Format',
                                         `download_link` text CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NOT NULL COMMENT 'Download Link',
                                         `created_at` datetime(3) DEFAULT NULL COMMENT 'Create Time',
                                         `updated_at` datetime(3) DEFAULT NULL COMMENT 'Update Time',
                                         PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=7 DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_general_ci;

-- ----------------------------
-- Records of subscribe_application
-- ----------------------------
BEGIN;
INSERT INTO `subscribe_application` (`id`, `name`, `icon`, `description`, `scheme`, `user_agent`, `is_default`, `subscribe_template`, `output_format`, `download_link`, `created_at`, `updated_at`) VALUES (1, 'Default', '', '', '', 'default', 1, '{{- range $n := .Proxies }}\n  {{- $dn := urlquery (default \"node\" $n.Name) -}}\n  {{- $sni := default $n.Host $n.SNI -}}\n\n  {{- if eq $n.Type \"shadowsocks\" -}}\n    {{- $userinfo := b64enc (print $n.Method \":\" $.UserInfo.Password) -}}\n    {{- printf \"ss://%s@%s:%v#%s\" $userinfo $n.Host $n.Port $dn -}}\n    {{- \"\\n\" -}}\n  {{- end -}}\n\n  {{- if eq $n.Type \"trojan\" -}}\n    {{- $qs := \"security=tls\" -}}\n    {{- if $sni }}{{ $qs = printf \"%s&sni=%s\" $qs (urlquery $sni) }}{{ end -}}\n    {{- if $n.AllowInsecure }}{{ $qs = printf \"%s&allowInsecure=%v\" $qs $n.AllowInsecure }}{{ end -}}\n    {{- if $n.Fingerprint }}{{ $qs = printf \"%s&fp=%s\" $qs (urlquery $n.Fingerprint) }}{{ end -}}\n    {{- printf \"trojan://%s@%s:%v?%s#%s\" $.UserInfo.Password $n.Host $n.Port $qs $dn -}}\n    {{- \"\\n\" -}}\n  {{- end -}}\n\n  {{- if eq $n.Type \"vless\" -}}\n    {{- $qs := \"encryption=none\" -}}\n    {{- if $n.RealityPublicKey -}}\n      {{- $qs = printf \"%s&security=reality\" $qs -}}\n      {{- $qs = printf \"%s&pbk=%s\" $qs (urlquery $n.RealityPublicKey) -}}\n      {{- if $n.RealityShortId }}{{ $qs = printf \"%s&sid=%s\" $qs (urlquery $n.RealityShortId) }}{{ end -}}\n    {{- else -}}\n      {{- if or $n.SNI $n.Fingerprint $n.AllowInsecure }}\n        {{- $qs = printf \"%s&security=tls\" $qs -}}\n      {{- end -}}\n    {{- end -}}\n    {{- if $n.SNI }}{{ $qs = printf \"%s&sni=%s\" $qs (urlquery $n.SNI) }}{{ end -}}\n    {{- if $n.AllowInsecure }}{{ $qs = printf \"%s&allowInsecure=%v\" $qs $n.AllowInsecure }}{{ end -}}\n    {{- if $n.Fingerprint }}{{ $qs = printf \"%s&fp=%s\" $qs (urlquery $n.Fingerprint) }}{{ end -}}\n    {{- if $n.Network }}{{ $qs = printf \"%s&type=%s\" $qs $n.Network }}{{ end -}}\n    {{- if $n.Path }}{{ $qs = printf \"%s&path=%s\" $qs (urlquery $n.Path) }}{{ end -}}\n    {{- if $n.ServiceName }}{{ $qs = printf \"%s&serviceName=%s\" $qs (urlquery $n.ServiceName) }}{{ end -}}\n    {{- if $n.Flow }}{{ $qs = printf \"%s&flow=%s\" $qs (urlquery $n.Flow) }}{{ end -}}\n    {{- printf \"vless://%s@%s:%v?%s#%s\" $n.ServerKey $n.Host $n.Port $qs $dn -}}\n    {{- \"\\n\" -}}\n  {{- end -}}\n\n  {{- if eq $n.Type \"vmess\" -}}\n    {{- $obj := dict\n        \"v\" \"2\"\n        \"ps\" $n.Name\n        \"add\" $n.Host\n        \"port\" $n.Port\n        \"id\" $n.ServerKey\n        \"aid\" 0\n        \"net\" (or $n.Network \"tcp\")\n        \"type\" \"none\"\n        \"path\" (or $n.Path \"\")\n        \"host\" $n.Host\n      -}}\n    {{- if or $n.SNI $n.Fingerprint $n.AllowInsecure }}{{ $_ := set $obj \"tls\" \"tls\" }}{{ end -}}\n    {{- if $n.SNI }}{{ $_ := set $obj \"sni\" $n.SNI }}{{ end -}}\n    {{- if $n.Fingerprint }}{{ $_ := set $obj \"fp\" $n.Fingerprint }}{{ end -}}\n    {{- printf \"vmess://%s\" (b64enc (toJson $obj)) -}}\n    {{- \"\\n\" -}}\n  {{- end -}}\n\n  {{- if or (eq $n.Type \"hysteria2\") (eq $n.Type \"hy2\") -}}\n    {{- $qs := \"\" -}}\n    {{- if $n.SNI }}{{ $qs = printf \"sni=%s\" (urlquery $n.SNI) }}{{ end -}}\n    {{- if $n.AllowInsecure }}{{ $qs = printf \"%s&insecure=%v\" $qs $n.AllowInsecure }}{{ end -}}\n    {{- if $n.ObfsPassword }}{{ $qs = printf \"%s&obfs-password=%s\" $qs (urlquery $n.ObfsPassword) }}{{ end -}}\n    {{- printf \"hy2://%s@%s:%v\" $.UserInfo.Password $n.Host $n.Port -}}\n    {{- if gt (len $qs) 0 -}}?{{ $qs }}{{- end -}}\n    {{- printf \"#%s\" $dn -}}\n    {{- \"\\n\" -}}\n  {{- end -}}\n\n  {{- if eq $n.Type \"tuic\" -}}\n    {{- $qs := \"\" -}}\n    {{- if $n.SNI }}{{ $qs = printf \"sni=%s\" (urlquery $n.SNI) }}{{ end -}}\n    {{- if $n.AllowInsecure }}{{ $qs = printf \"%s&insecure=%v\" $qs $n.AllowInsecure }}{{ end -}}\n    {{- printf \"tuic://%s:%s@%s:%v\" $n.ServerKey $.UserInfo.Password $n.Host $n.Port -}}\n    {{- if gt (len $qs) 0 -}}?{{ $qs }}{{- end -}}\n    {{- printf \"#%s\" $dn -}}\n    {{- \"\\n\" -}}\n  {{- end -}}\n\n  {{- if eq $n.Type \"anytls\" -}}\n    {{- $qs := \"\" -}}\n    {{- if $n.SNI }}{{ $qs = printf \"sni=%s\" (urlquery $n.SNI) }}{{ end -}}\n    {{- printf \"anytls://%s@%s:%v\" $.UserInfo.Password $n.Host $n.Port -}}\n    {{- if gt (len $qs) 0 -}}?{{ $qs }}{{- end -}}\n    {{- printf \"#%s\" $dn -}}\n    {{- \"\\n\" -}}\n  {{- end -}}\n\n{{- end }}', 'base64', '{}', '2025-08-12 22:57:56.711', '2025-08-15 21:45:20.181');
INSERT INTO `subscribe_application` (`id`, `name`, `icon`, `description`, `scheme`, `user_agent`, `is_default`, `subscribe_template`, `output_format`, `download_link`, `created_at`, `updated_at`) VALUES (2, 'Shadowsocket', '', '', 'shadowrocket://add/sub://${window.btoa(url)}?remark=${encodeURIComponent(name)}', 'Shadowsocket', 0, '{{- $GiB := 1073741824.0 -}}\n{{- $used := printf \"%.2f\" (divf (add (.UserInfo.Download | default 0 | float64) (.UserInfo.Upload | default 0 | float64)) $GiB) -}}\n{{- $total := printf \"%.2f\" (divf (.UserInfo.Traffic | default 0 | float64) $GiB) -}}\n\n{{- $exp := \"\" -}}\n{{- if or (kindIs \"int\" .UserInfo.ExpiredAt) (kindIs \"int64\" .UserInfo.ExpiredAt) (kindIs \"float64\" .UserInfo.ExpiredAt) -}}\n  {{- $exp = (date \"2006-01-02 15:04:05\" (unixEpoch .UserInfo.ExpiredAt)) -}}\n{{- else -}}\n  {{- $expStr := printf \"%v\" .UserInfo.ExpiredAt -}}\n  {{- if regexMatch `^[0-9]+$` $expStr -}}\n    {{- $ts := $expStr | int64 -}}\n    {{- $sec := ternary (divf ($ts | float64) 1000.0 | int64) $ts (ge (len $expStr) 13) -}}\n    {{- $exp = (date \"2006-01-02 15:04:05\" (unixEpoch $sec)) -}}\n  {{- else if regexMatch `^[0-9]{4}-[0-9]{2}-[0-9]{2}$` $expStr -}}\n    {{- $exp = (printf \"%s 00:00:00\" $expStr) -}}\n  {{- else if regexMatch `^[0-9]{4}-[0-9]{2}-[0-9]{2}[ T][0-9]{2}:[0-9]{2}:[0-9]{2}$` $expStr -}}\n    {{- $exp = (replace $expStr \"T\" \" \") -}}\n  {{- else if regexMatch `^[0-9]{4}-[0-9]{2}-[0-9]{2}T[0-9]{2}:[0-9]{2}:[0-9]{2}.*` $expStr -}}\n    {{- $t := mustToDate \"2006-01-02T15:04:05Z07:00\" $expStr -}}\n    {{- $exp = (date \"2006-01-02 15:04:05\" $t) -}}\n  {{- else -}}\n    {{- $exp = $expStr -}}\n  {{- end -}}\n{{- end -}}\n\nREMARKS={{ .SiteName }}-{{ .SubscribeName }}\nSTATUS=Traffic: {{ $used }} GiB/{{ $total }} GiB | Expires: {{ $exp }}\n{{ range $n := .Proxies }}\n  {{- $dn := default \"node\" $n.Name -}}\n  {{- $sni := default $n.Host $n.SNI -}}\n  {{- $common := \"udp=1&tfo=1\" -}}\n\n  {{- if eq $n.Type \"shadowsocks\" -}}\n    {{- $userinfo := b64enc (print $n.Method \":\" $.UserInfo.Password) -}}\n    {{- printf \"ss://%s@%s:%v?%s#%s\" $userinfo $n.Host $n.Port $common $dn -}}\n    {{- \"\\n\" -}}\n  {{- end -}}\n\n  {{- if eq $n.Type \"trojan\" -}}\n    {{- $qs := printf \"security=tls&%s\" $common -}}\n    {{- if $sni }}{{ $qs = printf \"%s&sni=%s\" $qs (urlquery $sni) }}{{ end -}}\n    {{- if $n.AllowInsecure }}{{ $qs = printf \"%s&allowInsecure=%v\" $qs $n.AllowInsecure }}{{ end -}}\n    {{- if $n.Fingerprint }}{{ $qs = printf \"%s&fp=%s\" $qs (urlquery $n.Fingerprint) }}{{ end -}}\n    {{- printf \"trojan://%s@%s:%v?%s#%s\" $.UserInfo.Password $n.Host $n.Port $qs $dn -}}\n    {{- \"\\n\" -}}\n  {{- end -}}\n\n  {{- if eq $n.Type \"vless\" -}}\n    {{- $qs := printf \"encryption=none&%s\" $common -}}\n    {{- if $n.RealityPublicKey -}}\n      {{- $qs = printf \"%s&security=reality\" $qs -}}\n      {{- $qs = printf \"%s&pbk=%s\" $qs (urlquery $n.RealityPublicKey) -}}\n      {{- if $n.RealityShortId }}{{ $qs = printf \"%s&sid=%s\" $qs (urlquery $n.RealityShortId) }}{{ end -}}\n    {{- else -}}\n      {{- if or $n.SNI $n.Fingerprint $n.AllowInsecure }}\n        {{- $qs = printf \"%s&security=tls\" $qs -}}\n      {{- end -}}\n    {{- end -}}\n    {{- if $n.SNI }}{{ $qs = printf \"%s&sni=%s\" $qs (urlquery $n.SNI) }}{{ end -}}\n    {{- if $n.AllowInsecure }}{{ $qs = printf \"%s&allowInsecure=%v\" $qs $n.AllowInsecure }}{{ end -}}\n    {{- if $n.Fingerprint }}{{ $qs = printf \"%s&fp=%s\" $qs (urlquery $n.Fingerprint) }}{{ end -}}\n    {{- if $n.Network }}{{ $qs = printf \"%s&type=%s\" $qs $n.Network }}{{ end -}}\n    {{- if $n.Path }}{{ $qs = printf \"%s&path=%s\" $qs (urlquery $n.Path) }}{{ end -}}\n    {{- if $n.ServiceName }}{{ $qs = printf \"%s&serviceName=%s\" $qs (urlquery $n.ServiceName) }}{{ end -}}\n    {{- if $n.Flow }}{{ $qs = printf \"%s&flow=%s\" $qs (urlquery $n.Flow) }}{{ end -}}\n    {{- printf \"vless://%s@%s:%v?%s#%s\" $n.ServerKey $n.Host $n.Port $qs $dn -}}\n    {{- \"\\n\" -}}\n  {{- end -}}\n\n  {{- if eq $n.Type \"vmess\" -}}\n    {{- $obj := dict\n        \"v\" \"2\"\n        \"ps\" $n.Name\n        \"add\" $n.Host\n        \"port\" $n.Port\n        \"id\" $n.ServerKey\n        \"aid\" 0\n        \"net\" (or $n.Network \"tcp\")\n        \"type\" \"none\"\n        \"path\" (or $n.Path \"\")\n        \"host\" $n.Host\n      -}}\n    {{- if or $n.SNI $n.Fingerprint $n.AllowInsecure }}{{ $_ := set $obj \"tls\" \"tls\" }}{{ end -}}\n    {{- if $n.SNI }}{{ $_ := set $obj \"sni\" $n.SNI }}{{ end -}}\n    {{- if $n.Fingerprint }}{{ $_ := set $obj \"fp\" $n.Fingerprint }}{{ end -}}\n    {{- printf \"vmess://%s\" (b64enc (toJson $obj)) -}}\n    {{- \"\\n\" -}}\n  {{- end -}}\n\n  {{- if or (eq $n.Type \"hysteria2\") (eq $n.Type \"hy2\") -}}\n    {{- $qs := $common -}}\n    {{- if $n.SNI }}{{ $qs = printf \"%s&sni=%s\" $qs (urlquery $n.SNI) }}{{ end -}}\n    {{- if $n.AllowInsecure }}{{ $qs = printf \"%s&insecure=%v\" $qs $n.AllowInsecure }}{{ end -}}\n    {{- if $n.ObfsPassword }}{{ $qs = printf \"%s&obfs-password=%s\" $qs (urlquery $n.ObfsPassword) }}{{ end -}}\n    {{- if $n.HopPorts }}{{ $qs = printf \"%s&hop-ports=%s\" $qs (urlquery $n.HopPorts) }}{{ end -}}\n    {{- if $n.HopInterval }}{{ $qs = printf \"%s&hop-interval=%v\" $qs $n.HopInterval }}{{ end -}}\n    {{- printf \"hy2://%s@%s:%v?%s#%s\" $.UserInfo.Password $n.Host $n.Port $qs $dn -}}\n    {{- \"\\n\" -}}\n  {{- end -}}\n\n  {{- if eq $n.Type \"tuic\" -}}\n    {{- $qs := $common -}}\n    {{- if $n.SNI }}{{ $qs = printf \"%s&sni=%s\" $qs (urlquery $n.SNI) }}{{ end -}}\n    {{- if $n.AllowInsecure }}{{ $qs = printf \"%s&insecure=%v\" $qs $n.AllowInsecure }}{{ end -}}\n    {{- if $n.DisableSNI }}{{ $qs = printf \"%s&disable-sni=%v\" $qs $n.DisableSNI }}{{ end -}}\n    {{- if $n.ReduceRtt }}{{ $qs = printf \"%s&reduce-rtt=%v\" $qs $n.ReduceRtt }}{{ end -}}\n    {{- if $n.UDPRelayMode }}{{ $qs = printf \"%s&udp-relay-mode=%s\" $qs (urlquery $n.UDPRelayMode) }}{{ end -}}\n    {{- if $n.CongestionController }}{{ $qs = printf \"%s&congestion-controller=%s\" $qs (urlquery $n.CongestionController) }}{{ end -}}\n    {{- printf \"tuic://%s:%s@%s:%v?%s#%s\" $n.ServerKey $.UserInfo.Password $n.Host $n.Port $qs $dn -}}\n    {{- \"\\n\" -}}\n  {{- end -}}\n\n  {{- if eq $n.Type \"anytls\" -}}\n    {{- $qs := $common -}}\n    {{- if $n.SNI }}{{ $qs = printf \"%s&sni=%s\" $qs (urlquery $n.SNI) }}{{ end -}}\n    {{- printf \"anytls://%s@%s:%v?%s#%s\" $.UserInfo.Password $n.Host $n.Port $qs $dn -}}\n    {{- \"\\n\" -}}\n  {{- end -}}\n\n{{- end }}', 'base64', '{}', '2025-08-12 23:03:50.004', '2025-08-15 22:01:39.221');
INSERT INTO `subscribe_application` (`id`, `name`, `icon`, `description`, `scheme`, `user_agent`, `is_default`, `subscribe_template`, `output_format`, `download_link`, `created_at`, `updated_at`) VALUES (3, 'Clash', '', '', 'clash://install-config?url=${url}&name=${name}', 'Clash', 0, 'port: 8888\nsocks-port: 8889\nmixed-port: 8899\nallow-lan: true\nmode: Rule\nlog-level: info\nexternal-controller: \'127.0.0.1:6170\'\nsecret: {{ .SiteName }}\nexperimental:\n    ignore-resolve-fail: true\ncfw-latency-url: \'http://cp.cloudflare.com/generate_204\'\ncfw-latency-timeout: 3000\ncfw-latency-type: 1\ncfw-conn-break-strategy: true\nclash-for-android:\n    ui-subtitle-pattern: \'\'\nurl-rewrite:\n    - \'^https?:\\/\\/(www.)?(g|google)\\.cn https://www.google.com 302\'\n    - \'^https?:\\/\\/(ditu|maps).google\\.cn https://maps.google.com 302\'\nproxies:\n{{- range $proxy := .Proxies }}\n  {{- if eq $proxy.Type \"shadowsocks\" }}\n    - { name: \'{{ $proxy.Name }}\', type: ss, server: {{ $proxy.Host }}, port: {{ $proxy.Port }}, cipher: {{ default \"aes-128-gcm\" $proxy.Method }}, password: {{ $.UserInfo.Password }}, udp: false{{- if $proxy.Network }}, plugin: obfs, plugin-opts: { mode: http, host: {{ $proxy.SNI | default $proxy.Host }} }{{ end }} }\n  {{- else if eq $proxy.Type \"trojan\" }}\n    - { name: \'{{ $proxy.Name }}\', type: trojan, server: {{ $proxy.Host }}, port: {{ $proxy.Port }}, password: {{ $.UserInfo.Password }}{{- if $proxy.SNI }}, sni: {{ $proxy.SNI }}{{ end }}{{- if $proxy.AllowInsecure }}, skip-cert-verify: {{ $proxy.AllowInsecure }}{{ end }}{{- if $proxy.Fingerprint }}, fingerprint: {{ $proxy.Fingerprint }}{{ end }} }\n  {{- else if eq $proxy.Type \"vless\" }}\n    - { name: \'{{ $proxy.Name }}\', type: vless, server: {{ $proxy.Host }}, port: {{ $proxy.Port }}, uuid: {{ $proxy.ServerKey }}, udp: true{{- if $proxy.Network }}, network: {{ $proxy.Network }}{{ end }}{{- if $proxy.Path }}, ws-opts: { path: {{ $proxy.Path }} }{{ end }}{{- if $proxy.ServiceNam